const initialState = {
  ary: [
    {
        title: 'Code Nicely',
        body: 'hi i m prince working as front end devloper in code nicely'
       },
       {
        title: 'Smileboat',
        body: 'hi i m prince working as front end devloper in code nicely'
       }
  ]
}

const reducer = (state=initialState,action)=>{
  switch(action.type){
    case "Add_note" : 
      state.ary.concat({
        title: action.value.title, body: action.value.body,
        _id: Math.floor(Math.random() * 100)
      })
      break
    default:
      return state
  }
}
export default reducer
